import axios from 'axios';

const COVID_TRACKER_API_URL = 'http://localhost:8080/covid-api/in';

class CovidTrackerService { 
    getData() {
        return axios.get(COVID_TRACKER_API_URL).then((data)=>{
            return data;
        }).catch((err)=>{
            console.log(err);
        })
    }
}

export default new CovidTrackerService();
